import LedgerLogo from '../assets/ledger_logo.svg'
import CertikLogo from '../assets/certik_logo.svg'
import ChainLogo from '../assets/chainanalysis_logo.svg'
import SumLogo from '../assets/sum_logo.svg'
import TVLogo from '../assets/tradingview_logo.svg'
import FBLOGO from '../assets/fireblocks_logo.svg'

export default function LogoTicker() {

    return (
        <div className="logos">
        <div className="logos-slide">

       <img src={LedgerLogo} alt="" /> 
        {CertikLogo}
        {ChainLogo}
        {SumLogo}
        {TVLogo}
        {FBLOGO}


        {LedgerLogo}
        {CertikLogo}
        {ChainLogo}
        {SumLogo}
        {TVLogo}
        {FBLOGO}

        </div>

        <div className="logos-slide">
        {LedgerLogo}
        {CertikLogo}
        {ChainLogo}
        {SumLogo}
        {TVLogo}
        {FBLOGO}        {LedgerLogo}
        {CertikLogo}
        {ChainLogo}
        {SumLogo}
        {TVLogo}
        {FBLOGO}

        </div>
      </div>

    )
}
